import { useParams } from "react-router-dom";

function CardInfo({ data }) {
  const { title } = useParams();

  return (
    <>
      <section>
        <div>
          {data
            .filter((item) => item.title === title)
            .map((item, index) => (
              <div key={index}>
                <h2>{item.title}</h2>
                <p>{item.article}</p>
              </div>
            ))}
        </div>
      </section>
    </>
  );
}

export default CardInfo;
